import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Provider } from 'react-redux';
import store from './store/store'; // Adjust path based on your project structure

import { IntlProvider } from 'react-intl';
import frenchMessages from '../src/locales/fr.json';
import englishMessages from '../src/locales/en.json';

const local = navigator.language;
let messages;
if (local === 'en') {
  messages = englishMessages;
} else {
  messages = frenchMessages;
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <IntlProvider locale={local} messages={messages}>
    <Provider store={store}>
      <React.StrictMode>
        <App />
      </React.StrictMode>
    </Provider>
  </IntlProvider>
);

reportWebVitals(console.log); // or remove if not needed
